import React, { useState } from "react";

function CatCard({
  name,
  image,
  age,
  favoriteMovie
}) {

  return (
    <li className="card">
      <img src={image} alt={name} />
      <h4>{favoriteMovie}</h4>
      <p>Age: {age}</p>
    </li>
  );
}

export default PlantCard;
